const CarouselItems = [
    {
      item : {
              'itemcName' : 'd-block w-100',
              'itemsrc' : '/images/img1.jpg',
              'itemalt' : 'First slide'
            },
      caption : ''
    },
    {
      item : {
              'cName' : 'd-block w-100',
              'src' : '/images/img2.jpg',
              'alt' : 'Second slide'
            },
      caption : ''
    },
    {
    item : {
            'cName' : 'd-block w-100',
            'src' : '/images/img3.jpg',
            'alt' : 'Third slide'
          },
    caption : ''
    }
]
export default CarouselItems;
